import React from 'react';

const InputDOB = ({ dob, setDob, fetchData }) => {
  return (
    <div>
      <h2>Enter Your Date of Birth</h2>
      <input
        type="date"
        value={dob}
        onChange={(e) => setDob(e.target.value)}
        onBlur={fetchData}
        placeholder="Enter your DOB"
      />
    </div>
  );
};

export default InputDOB;
